import React, { useState } from 'react' 
import { useHistory } from "react-router-dom";
import sd from "../assets/img/ZooLogos/SanDiego.png";
import bronx from "../assets/img/ZooLogos/bronx.png";

function Navigation() {
    let history = useHistory();

    function handleClick(src) {
      history.push("/AcctPage", src)
    }
    //const debug = () => console.log(history.location());

    return (
     <div>
        <div imgSrc={sd}>
        <button onClick={handleClick(this.src)} type="button">
            <img 
                src={sd} 
                id="icon"
                alt="SDZooLogo" 
                title="SDZoo"> 
            </img>
        </button>
        </div>
        <div imgSrc={bronx}>
        <button src={bronx} onClick={handleClick(this.src)} type="button">
            <img 
                src={bronx} 
                id="icon"
                alt="BronxZooLogo" 
                title="BronxZoo"> 
            </img>
        </button>
        </div>
     </div>
    );
  }
  export default Navigation;
